#include <iostream>
#include <algorithm>
#include <vector>

using namespace std;

class Solution
{
public:
    string longestCommonPrefix(vector<string> &strs)
    {
        if (strs.size() == 0)
            return "";

        int len = binarySearch(strs, 0, strs.size());
        return strs[0].substr(0, len);
    }

    int binarySearch(vector<string> &strs, int start, int end)
    {
        if (start + 1 == end)
            return strs[start].size();

        int mid = (start + end) / 2;
        int len1 = binarySearch(strs, start, mid);
        int len2 = binarySearch(strs, mid, end);
        int len = min(len1, len2);

        for (int i = 0; i < len; i++)
            if (strs[start][i] != strs[mid][i])
                return i;
        return len;
    }
};

